import React from 'react' 

const ToDoList = (props) => {
    console.log(props);
    return (
        <ul>
            {props.list.map(item => {
                return (
                    <li key={item.Name}>
                        <span> Item name : {item.itemName} </span>
                        <span>  {item.complete} </span>
                        <input type="checkbox" value={item.complete}/>
                    </li>
                )
            })}




        </ul>
    )
}
export default ToDoList;
